-- ************************************************************************************************
-- Create view
-- ************************************************************************************************

CREATE VIEW seatsPerScreening 
	AS SELECT se.id AS seat, sc.id AS screening 
	FROM seat se 
	INNER JOIN screening sc 
	ON se.fk_hall = sc.fk_hall;

